import React, {Component} from 'react';
import { Table,Header,HeaderRow,HeaderCell,Body,Row,Cell} from '@table-library/react-table-library/table';
import Create from './add.js';


class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      importance: 'high',
      title : 'SPARCS',
      task: 'homework for newbies',
      deadline: "today",
    }
  };

  render() {
    console.log('working!'); 
    return (
      <>
      <Table data={this.state}>{(tableList) => (
        <>
        <Header>
          <HeaderRow>
            <HeaderCell>Importance</HeaderCell>
            <HeaderCell>Title</HeaderCell>
            <HeaderCell>Detail</HeaderCell>
            <HeaderCell>Deadline</HeaderCell>
          </HeaderRow>
        </Header>
        <Body>
        {tableList.map((item) => (
          <Row key={item.id} item={item}>
            <Cell>{item.importance}</Cell>
            <Cell>{item.title}</Cell>
            <Cell>{item.detail}</Cell>
            <Cell>{item.deadline}</Cell>
          </Row>
        ))}
      </Body>
      </>
      )}</Table><br/>
    </>
    );
  }



};

export default App;
